class ProdustDetails extends Component{
    state={
        data: {_id:"",
        Name:"",
        Description:"",
        Price:"",
        Categery:"",
        SellingBy:"",
        }
    }
    render(){
        return(
            <div className=" ml-3">
            <h1 className="mt-2 mb-5">Product</h1>
        <form>
            {this.inputRender("Product name", "text", "Name", data.Name)}
            {this.inputRender("Email", "email", "email", data.email)}
            {this.inputRender("Password", "password", "password", data.password)}
            {this.btnRender("Submit")}
        </form>
        </div>
        )
    }
}

export default ProdustDetails;
